class Solution:
    def fastSum(self, n_start: int, n_end: int) -> int:
        if n_end < n_start:
            return 0
        # 等差数列の和の公式: (初項 + 末項) × 項数 ÷ 2
        return (n_start + n_end) * (n_end - n_start + 1) // 2

    def minimalKSum(self, nums: list[int], k: int) -> int:
        # 重複を除去してソート
        unique_nums = sorted(set(nums))
        
        total = 0
        current = 1  # 追加する最小の正の整数から始める
        
        for num in unique_nums:
            if k == 0:
                break
                
            # current から num-1 までの範囲で k個まで追加
            if current < num:
                # 追加できる数の個数
                available = num - current
                # 実際に追加する個数
                add_count = min(k, available)
                # current から current+add_count-1 までの和を計算
                total += self.fastSum(current, current + add_count - 1)
                k -= add_count
                
            # 次の開始点は num の次の数
            current = num + 1
            
        # まだ k > 0 なら、残りを current から追加
        if k > 0:
            total += self.fastSum(current, current + k - 1)
            
        return total

